// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./IERC20.sol";

contract TokenSwap {

    IERC20 public tokenFrom;
    IERC20 public tokenTo;

    constructor() {}

    function swap( address _tokenFrom, address accountFrom, uint _amountFrom, address _tokenTo, address accountTo, uint _amountTo) public {

        tokenFrom = IERC20(_tokenFrom);
        tokenTo = IERC20(_tokenTo);

        require(tokenFrom.allowance(accountFrom, address (this)) >= _amountFrom, "Allow tokenFrom too low");
        require(tokenTo.allowance(accountTo, address (this)) >= _amountFrom, "Allow tokenFrom too low");

        _safeTransferFrom(tokenFrom, accountFrom, accountTo, _amountFrom);
        _safeTransferFrom(tokenTo, accountTo, accountFrom, _amountTo);
    }

    function _safeTransferFrom(
        IERC20 token,
        address sender,
        address recipient,
        uint amount
    ) private {
        bool sent = token.transferFrom(sender, recipient, amount);
        require(sent, "Token transfer failed");
    }

}
